  return (
    <>
      <NavBar />
      <WelcomeBlock />
      <AboutCourceBlock />
      <PhotoBaner />
      <BuyCourse />
      {
        //<BuyConfirmation />
      }
      <Caroucel />
      <ForWho />
      <Card />
      <Team />
      <CaseCard />
      <ContactMe />

      <СourseContent />
      {
        //<ThanksBlock />
      }
      <Footer />
    </>
  );
}

export default App;
